有时候代码会处理借用和拥有数据的混合。想象一下错误消息的向量，其中一些是静态字符串文字，而另一些是使用 format! 构造的。显而易见的表示是 Vec<String>，如下例所示。 let mut errors: Vec<String> = vec![];
errors.push("something went wrong".to_string());
errors.push(format!("something went wrong on line {}", 100)); 这需要一个 to_string 调用将静态字符串文字提升为 String，这会导致分配。 相反，可以使用 Cow 类型，它可以保存借用或拥有的数据。借用值 x 被包装在 Cow::Borrowed(x) 中，而拥有值 y 被包装在 Cow::Owned(y) 中。Cow 还为各种字符串、切片和路径类型实现了 From<T> trait，因此通常也可以使用 into。 （或者 Cow::from，它更长但更易读，因为它使类型更清晰。）以下示例将所有内容结合在一起。 use std::borrow::Cow;
let mut errors: Vec<Cow<'static, str>> = vec![];
errors.push(Cow::Borrowed("something went wrong"));
errors.push(Cow::Owned(format!("something went wrong on line {}", 100)));
errors.push(Cow::from("something else went wrong"));
errors.push(format!("something else went wrong on line {}", 101).into()); errors 现在保存了借用和拥有的数据，而不需要任何额外的分配。此示例涉及 &str/String，但其他配对，如 &[T]/Vec<T> 和 &Path/PathBuf 也是可能的。

