BufRead::lines 使逐行读取文件变得容易： # fn blah() -> Result<(), std::io::Error> {
# fn process(_: &str) {}
use std::io::{self, BufRead};
let mut lock = io::stdin().lock();
for line in lock.lines() { process(&line?);
}
# Ok(())
# } 但它生成的迭代器返回 io::Result<String>，这意味着它为文件中的每一行进行分配。 使用循环遍历 [BufRead::read_line] 中的工作集合 String 是一种替代方法： # fn blah() -> Result<(), std::io::Error> {
# fn process(_: &str) {}
use std::io::{self, BufRead};
let mut lock = io::stdin().lock();
let mut line = String::new();
while lock.read_line(&mut line)? != 0 { process(&line); line.clear();
}
# Ok(())
# } 这样可以将分配数量减少到最多一小撮，甚至可能只有一个。（确切的数量取决于需要多少次重新分配 line，这取决于文件中行长度的分布。） 只有当循环体可以处理 &str 而不是 String 时，这才有效。 示例 。

