Rust 的 print! 和 println! 宏在每次调用时都会锁定标准输出(stdout)。如果你重复调用这些宏，手动锁定标准输出可能会更好。 例如，将这段代码改为： # let lines = vec!["one", "two", "three"];
for line in lines { println!("{}", line);
} 改为这样： # fn blah() -> Result<(), std::io::Error> {
# let lines = vec!["one", "two", "three"];
use std::io::Write;
let mut stdout = std::io::stdout();
let mut lock = stdout.lock();
for line in lines { writeln!(lock, "{}", line)?;
}
// 当 `lock` 被丢弃时，标准输出会解锁
# Ok(())
# } 当对标准输入(stdin)和标准错误(stderr)进行重复操作时，同样可以进行锁定。

